PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK WHERE {
  <https://dblp.org/rec/conf/recomb/SongL06> dblp:yearOfPublication "2007" ^^ xsd:gYear .
}

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?pub ) AS ?count ) WHERE {
  VALUES ?author {
    <https://dblp.org/pid/q/MeikangQiu> <https://dblp.org/pid/164/3309> <https://dblp.org/pid/184/6425>
  }
  ?pub dblp:authoredBy ?author .
  {
    ?pub dblp:yearOfPublication "2016" ^^ xsd:gYear .
  } UNION {
    ?pub dblp:yearOfEvent "2016" ^^ xsd:gYear .
  }
}

PREFIX owl: <http://www.w3.org/2002/07/owl#>
SELECT DISTINCT ?wikidata WHERE {
  <https://dblp.org/pid/o/AJeffersonOffutt> owl:sameAs ?wikidata .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?venue ?venueLabel WHERE {
  <https://dblp.org/rec/journals/jlp/ShieberSP95> dblp:publishedInStream ?venue .
  OPTIONAL {
    ?venue rdfs:label ?venueLabel
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?author ?authorLabel ?venue ?venueLabel WHERE {
  VALUES ?author {
    <https://dblp.org/pid/19/2932-1> <https://dblp.org/pid/236/3060> <https://dblp.org/pid/40/4160> <https://dblp.org/pid/40/4731> <https://dblp.org/pid/55/2484-1>
  }
  ?pub dblp:authoredBy ?author .
  FILTER ( ?pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> ) ?pub dblp:publishedInStream ?venue .
  OPTIONAL {
    ?author rdfs:label ?authorLabel
  }
  OPTIONAL {
    ?venue rdfs:label ?venueLabel
  }
}
ORDER BY ?author ?venueLabel

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?pub ?title ?year WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/63/10539> .
  OPTIONAL {
    ?pub rdfs:label ?title .
  }
  OPTIONAL {
    ?pub dblp:yearOfPublication ?year .
  }
}
ORDER BY ?year ?title

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?pub ?pubLabel ?venueType WHERE {
  {
    ?pub dblp:authoredBy <https://dblp.org/pid/64/490> ; rdfs:label ?pubLabel .
    ?pub dblp:publishedInStream ?stream .
    ?stream rdfs:label ?streamLabel .
    FILTER ( CONTAINS( LCASE( str( ?streamLabel ) ) , "vehicular" ) || CONTAINS( LCASE( str( ?streamLabel ) ) , "vtc" ) ) OPTIONAL {
      ?pub owl:sameAs ?same .
    }
    OPTIONAL {
      ?pub dblp:documentPage ?doc .
    }
    FILTER ( ( BOUND( ?same ) && CONTAINS( LCASE( str( ?same ) ) , "spring" ) ) || ( BOUND( ?doc ) && CONTAINS( LCASE( str( ?doc ) ) , "spring" ) ) || CONTAINS( LCASE( str( ?pubLabel ) ) , "spring" ) ) BIND( "VTC Spring" AS ?venueType )
  } UNION {
    ?pub dblp:authoredBy <https://dblp.org/pid/64/490> ; rdfs:label ?pubLabel .
    OPTIONAL {
      ?pub dblp:publishedInStream ?stream .
      ?stream rdfs:label ?streamLabel .
    }
    OPTIONAL {
      ?pub owl:sameAs ?same .
    }
    OPTIONAL {
      ?pub dblp:documentPage ?doc .
    }
    FILTER ( ( BOUND( ?streamLabel ) && ( CONTAINS( LCASE( str( ?streamLabel ) ) , "corr" ) || CONTAINS( LCASE( str( ?streamLabel ) ) , "arxiv" ) ) ) || ( BOUND( ?same ) && ( CONTAINS( LCASE( str( ?same ) ) , "arxiv" ) || CONTAINS( LCASE( str( ?same ) ) , "corr" ) ) ) || ( BOUND( ?doc ) && ( CONTAINS( LCASE( str( ?doc ) ) , "arxiv" ) || CONTAINS( LCASE( str( ?doc ) ) , "corr" ) ) ) ) BIND( "CoRR" AS ?venueType )
  }
}
ORDER BY ?venueType ?pubLabel
LIMIT 200

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?author ( COUNT( DISTINCT ?pub ) AS ?paperCount ) WHERE {
  BIND( <https://dblp.org/pid/21/4802> AS ?author ) ?pub dblp:authoredBy ?author .
}
GROUP BY ?author

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?n ( COUNT( DISTINCT ?a ) AS ?count ) WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/journals/tcyb/MaB21> <https://dblp.org/rec/conf/etfa/Missal0H07>
  }
  OPTIONAL {
    ?pub dblp:numberOfCreators ?n
  }
  OPTIONAL {
    {
      ?pub dblp:authoredBy ?a
    } UNION {
      ?pub dblp:createdBy ?a
    } UNION {
      ?pub dblp:hasSignature ?sig .
      ?sig dblp:creator ?a
    }
  }
}
GROUP BY ?pub ?n
ORDER BY ?pub

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?coAuthor ?coName ?affiliation WHERE {
  {
    ?pub dblp:authoredBy ?authorNode .
    ?authorNode dblp:creatorName ?aName .
    FILTER ( CONTAINS( LCASE( STR( ?aName ) ) , "niels engell andersen" ) )
  } UNION {
    ?pub dblp:authoredBy <https://dblp.org/pid/286/6829> .
    BIND( <https://dblp.org/pid/286/6829> AS ?authorNode )
  }
  ?pub dblp:year ?year .
  FILTER ( xsd:integer ( ?year ) >= 2023 ) ?pub dblp:authoredBy ?coNode .
  ?coNode dblp:creatorName ?coName .
  FILTER ( STR( ?coNode ) != STR( ?authorNode ) ) OPTIONAL {
    ?coNode dblp:primaryAffiliation ?aff1
  }
  OPTIONAL {
    ?coNode dblp:affiliation ?aff2
  }
  BIND( COALESCE ( ?aff1 , ?aff2 ) AS ?affiliation ) BIND( ?coNode AS ?coAuthor )
}
ORDER BY ?coName
LIMIT 200

