PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( AVG( ?c ) AS ?avgPapersPerYear ) WHERE {
  {
    SELECT ?y ( COUNT( DISTINCT ?pub ) AS ?c ) WHERE {
      ?pub dblp:authoredBy <https://dblp.org/pid/45/1135> .
      OPTIONAL {
        ?pub dblp:yearOfPublication ?yp .
      }
      OPTIONAL {
        ?pub dblp:yearOfEvent ?ye .
      }
      BIND( COALESCE ( ?yp , ?ye ) AS ?y ) FILTER ( bound( ?y ) )
    }
    GROUP BY ?y
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?pub ?pubLabel ?stream ?streamLabel ?year ?page WHERE {
