PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX dc: <http://purl.org/dc/elements/1.1/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?pub ?title ?year WHERE {
  ?pub a dblp:Publication .
  FILTER ( CONTAINS( str( ?pub ) , "/rec/conf/hipc/" ) ) OPTIONAL {
    ?pub rdfs:label ?t1 .
  }
  OPTIONAL {
    ?pub dc:title ?t2 .
  }
  BIND( coalesce ( ?t1 , ?t2 , "" ) AS ?title ) OPTIONAL {
    ?pub dblp:yearOfEvent ?year .
  }
  FILTER ( CONTAINS( str( ?year ) , "2003" ) ) FILTER ( CONTAINS( LCASE( str( ?title ) ) , "overlay" ) || CONTAINS( LCASE( str( ?title ) ) , "multicast" ) )
}
LIMIT 100

