PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?author ?authorName WHERE {
  ?paper dblp:publishedInStream <https://dblp.org/streams/conf/infoseccd> .
  OPTIONAL {
    ?paper dblp:yearOfEvent ?yEvent
  }
  OPTIONAL {
    ?paper dblp:yearOfPublication ?yPub
  }
  FILTER ( ( bound( ?yEvent ) && ?yEvent = "2006" ^^ xsd:gYear ) || ( bound( ?yPub ) && ?yPub = "2006" ^^ xsd:gYear ) ) ?paper dblp:title ?title .
  FILTER ( regex( ?title , "information systems?" , "i" ) ) ?paper dblp:authoredBy ?author .
  OPTIONAL {
    ?author dblp:primaryCreatorName ?authorName
  }
}
ORDER BY ?authorName

