PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?pub ?title ?year WHERE {
  ?pub rdf:type dblp:Publication .
  {
    ?pub dblp:authoredBy <https://dblp.org/pid/s/RichardEdwinStearns> .
  } UNION {
    ?pub dblp:createdBy <https://dblp.org/pid/s/RichardEdwinStearns> .
  } UNION {
    ?pub dblp:hasSignature ?sig .
    ?sig dblp:signatureCreator <https://dblp.org/pid/s/RichardEdwinStearns> .
  }
  OPTIONAL {
    ?pub dblp:title ?title .
  }
  OPTIONAL {
    ?pub dblp:yearOfPublication ?y1 .
  }
  OPTIONAL {
    ?pub dblp:yearOfEvent ?y2 .
  }
  BIND( COALESCE ( ?y1 , ?y2 ) AS ?yearLiteral ) BIND( xsd:integer ( ?yearLiteral ) AS ?year ) FILTER ( ?year >= 2023 )
}
ORDER BY DESC ( ?year )

