  OPTIONAL {
    ?pub dblp:yearOfEvent ?y
  }
  OPTIONAL {
    ?pub dblp:yearOfPublication ?y2
  }
  FILTER ( ( bound( ?y ) && CONTAINS( str( ?y ) , "2020" ) ) || ( bound( ?y2 ) && CONTAINS( str( ?y2 ) , "2020" ) ) ) FILTER ( regex( ?streamTitle , "SCIS|ISIS" , "i" ) ) FILTER ( regex( ?title , "solution\\s*algorithm" , "i" ) || ( regex( ?title , "solution" , "i" ) && regex( ?title , "algorithm" , "i" ) ) ) {
    ?pub dblp:authoredBy ?author .
  } UNION {
    ?pub dblp:createdBy ?author .
  } UNION {
    ?pub terms:creator ?author .
  }
  OPTIONAL {
    ?author rdfs:label ?authorLabel
  }
}
