PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?paper ?title ( xsd:integer ( ?yearStr ) AS ?year ) ?venue ?venueLabel WHERE {
  BIND( <https://dblp.org/pid/81/1241> AS ?author ) ?paper a dblp:Publication .
  ?paper ( dblp:authoredBy | dblp:createdBy ) ?author .
  ?paper rdfs:label ?label .
  OPTIONAL {
    ?paper dblp:title ?t1 .
  }
  BIND( IF( bound( ?t1 ) , ?t1 , REPLACE( STR( ?label ) , '^[^:]+: (.*) \\(\\d{4}\\)$' , '$1' ) ) AS ?title ) BIND( IF( regex( STR( ?label ) , '\\(\\d{4}\\)$' ) , REPLACE( STR( ?label ) , '.*\\((\\d{4})\\)$' , '$1' ) , "" ) AS ?yearStr ) FILTER ( ?yearStr != "" && xsd:integer ( ?yearStr ) >= 2018 ) OPTIONAL {
    ?paper ( dblp:publishedIn | dblp:publishedInStream | dblp:publishedInSeries ) ?venue .
  }
  OPTIONAL {
    ?venue rdfs:label ?venueLabel .
  }
}
ORDER BY DESC ( xsd:integer ( ?yearStr ) ) ?title

